import { type } from '@testing-library/user-event/dist/type';
import React from 'react';
type GreetProps = {
    firstName: string
    messageCount: number
    isLoggedIn: boolean
}

const Greet = ({ firstName, messageCount, isLoggedIn }: GreetProps) => {
    return (
        <div>
            <h3>React Typescript.</h3>
            <span>My name is : { firstName }</span>
            <span>The value is: { messageCount }</span>
            <h3>
                {
                    (isLoggedIn) ? <p>Welcome Home</p> : <p>User not logged in.</p>
                }
            </h3>
        </div>
    );
};

export default Greet;
